import './App.css';
let name="Vinayak Santhosh";
function App() {
  return (
    <>
    <h1>This is Sparta!!!!</h1>
    <p>
      Geia Sas, {name}!! Sorry to startle you with the roaring and manly war cry up there!
      Feel free to explore the once renowned city that was ruled by the great Leonidas.
      Not the protagonist from the movie <a href="https://en.wikipedia.org/wiki/300_(film)" target="_blank"><img src="https://whatthelogo.com/storage/logos/frank-millers-300-8841.png" alt="300 movie logo"></img></a>, but the real King Leonidas.</p>
    {/* <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo logo-color" alt="logo" />
